import React, { Component } from 'react'

const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Name</th>
                <th>Job</th>
            </tr>
        </thead>
    )
}

class Table extends Component {
    render() {
        const { characterData} = this.props


        return (
      <table>
        <TableHeader />
        <TableBody />
      </table>
    )
  }
}

const TableBody = props => {

    const rows = props.characterData.map((row, index) => {

        return (

            <tr key = {index}>

                <td>{row.name}</td>
                <td>{row.job}</td>

            </tr>
        )
    })

}

export default Table
